export function hasShadowDom(el) {
    return !!el.shadowRoot && !!el.attachShadow;
}
export function getBreakPointBySize(width) {
    if (width < 480) {
        return 'xs';
    }
    else if (width < 540) {
        return 'sm';
    }
    else if (width < 768) {
        return 'md';
    }
    else {
        return 'lg';
    }
}
